window.bookSummaryJSON = "<p>\"Extinction Lost\" is a short story that should be read after book 6, Extinction Aftermath. NOTE: This story was originally published in <i>SNAFU: Black Ops</i>. </p> <p>The war continues â€¦ <br>Two days after the events of Extinction Aftermath, European Unified Command calls on Team Ghost for a top secret mission. The residents of a small Inuit fishing village in Greenland have gone missing and reports of Variants unaffected by Kryptonite have surfaced. </p> <p>Fatigued, injured, and unaware of the events back in the United States, Master Sergeant Joe Fitzpatrick leads Team Ghost into the remote and alien winter landscape to determine the fate of the missing villagers. But as the operation unfolds they discover a harrowing revelation that could impact the world war against the Variants, and the future of the human race. </p>"; 
